                        { "city_name": "Ludhiana" },
                        { "city_name": "Amritsar" },
                        { "city_name": "Kapurthala" }
                    ],
                    "Ghazni": [
                        { "city_name": "Udaipur" },
                        { "city_name": "Jodhpur" },
                        { "city_name": "Jaipur" }
                    ]
                }
            },
            {
                "country": "Bangladesh",
                "states": ["Barisal", "Chittagong", "Dhaka", "Khulna", "Rajshahi", "Sylhet", "Barisal Division", "Dhaka Division", "Sylhet Division", "Khulna Division"]
            },
            {
