                        { "city_name": "Gurgaon" },
                        { "city_name": "Ghaziabad" }
                    ],
                    "Goa": [
                        { "city_name": "Mapusa" },
                        { "city_name": "Margao" },
                        { "city_name": "Panaji" }
                    ],
                    "Gujarat": [
                        { "city_name": "Surat." },
                        { "city_name": "Ahmedabad." },
                        { "city_name": "Vadodara" }
                    ],
                    "Punjab": [
                        { "city_name": "Ludhiana" },
